RT @TheChiefNerd: MUST WATCH: Calley Means & Joe Rogan on What the Trump / RFK / Elon Alliance Means for the Future of America

"This is a question I have. Who do we believe is going to appoint people like RFK, people like Elon Musk, to stir stuff up? Who is gonna do that? To me, is the foundational question. And I do consider this the most important election of my lifetime, watching these two men because it is so genuine, and there is a genuine desire to truly transform, to see our broken corruption and institutions for what it is and really truly, I think prevent nuclear war and dramatically reverse our health crisis."

