RT @NicoleShanahan: Both parties are the same: they take money from special interest, they’re open for business, they pander to CEO’s. Americans have felt the effects: it results in corporate interests ahead of people, profits ahead of health, and censorship ahead of free speech.

Americans are ready for a third choice. For an independent ticket, that’s focused on restoring health, instead of pandering to CEOs.

@RobertKennedyJr bringing politics back to the people
